const userRoutes = [
  {
    path: '/register',
    name: 'register',
    // 惰性的加载页面,不是一次性全部都加载.只有在调用的时候才加载
    component: () => import('@/views/Register/Register.vue'),
  },
  {
    path: '/login',
    name: 'login',
    // eslint-disable-next-line import/no-unresolved
    component: () => import('@/views/Login/Login.vue'),
  },
];
export default userRoutes;
